        .main-div{
           text-align: center;
           width: 700px;
           border-radius: 15px;
           margin-left: auto;
           margin-right: auto;
           margin-top: 120px;
           background: rgb(214,231,255);
            background: linear-gradient(90deg, rgba(214,231,255,0.6166841736694677) 0%, rgba(151,151,255,0.7091211484593838) 35%, rgba(154,226,241,0.5858718487394958) 100%);
        }
        .Heading{
            font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;
            color: white;
            font-size: 40px;
        }
        
        input{
            width:250px;
            height:25px;
            border: none;
            border-radius: 10px;
            border-bottom: 3px solid rgb(11, 153, 229);
        }
        button{
            width: 70px;
            height: 28px;
            border-radius: 10px;
            border: none;
            background-color: rgb(132, 255, 255);
            
        }
        button:hover{
          background: rgb(214,231,255);
            background: linear-gradient(90deg, rgba(214,231,255,0.6166841736694677) 0%, rgba(112, 255, 210, 0.709) 35%, rgba(80, 212, 238, 0.586) 100%);
        }
        .info-div{
            text-align: left;
            /* border: 2px solid salmon; */
            width: 350px;
            margin-left: auto;
            margin-right: auto;
            padding-left: 50px;
            margin-top: 10px;
            font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;
        }
        .time{
            padding-left: 15px;
            padding-bottom: 230px;
          
        }
        table{
         font-size: 18px;
         color: black;
         
        }
        td{
          width: 180px;
          /* border: 2px solid red; */
        }

<body>
    <div class="main-div">
        <h1 class="Heading">The Weather App</h1>
        <div>
            <form action="." method="POST">
                {% csrf_token %}
                <input type="text" name="city" placeholder="search city...">
                <button type="submit">Search</button>
            </form>
        </div>
        <div class="info-div">
            <table>
                <tr>

                <td><img src="http://openweathermap.org/img/w/{{ city_weather_update.icon }}.png" style="width:75px" alt="">
                <h4>{{ city_weather_update.city }} {{ city_weather_update.country_code }}</h4>
                <h4>{{ city_weather_update.temperature }}</h4>
                <h4>{{ city_weather_update.description | title }}</h4>
                <h4>{{ city_weather_update.wind }}</h4>
                <h4>{{ city_weather_update.humidity }}</h4></td>
                <td><h4 class="time">{{ city_weather_update.time }}</h4></td> 
            </tr>
            </table>
        </div>
    </div>
</body>
</html>
